INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('4808', '3640', 'it', '0', '', 'Ciao USERNAME,\n\nil tuo nuovo sito SITE_NAME è stato correttamente creato ed impostato su:\nBLOG_URL\n\nPuoi effettuare l\'accesso all’account di amministrazione con le seguenti informazioni:\n\nNome utente: USERNAME\nPassword: PASSWORD\nEffettua l\'accesso qui: BLOG_URLwp-login.php\n\nSperiamo che il tuo nuovo sito ti piaccia. Grazie!\n\nIl team di SITE_NAME', '0', '', '0', '2018-06-20 09:50:54');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('4809', '3641', 'it', '0', '', 'Ciao USERNAME,\n\nil tuo nuovo account è pronto.\n\nPuoi effettuare l\'accesso con le seguenti informazioni:\nNome utente: USERNAME\nPassword: PASSWORD\nLOGINLINK\n\nGrazie!\nIl team di SITE_NAME', '0', '', '0', '2018-06-20 09:50:54');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('4810', '3642', 'it', '0', '', 'Ciao,\n\nÈ stata effettuata una richiesta per eseguire la seguente azione sul tuo account:\n\n     ###DESCRIPTION###\n\nPer confermare questa azione, fai clic sul seguente link:\n###CONFIRM_URL###\n\nPuoi tranquillamente ignorare ed eliminare questa email se non vuoi\neseguire questa azione.\n\nQuesta email è stata inviata a ###EMAIL###.\n\nSaluti,\na tutti da ###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:50:54');
