INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7470', '3619', 'ko', '0', '', '안녕하세요. HTML 코드를 텍스트 위젯의 비주얼 탭에 붙여넣으신 것 같습니다. 코드는 텍스트 탭에 넣으셔야 합니다. 또는 새로운 사용자 정의 HTML 위젯을 사용해보세요!', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7471', '3620', 'ko', '0', '', '안녕하세요. ###USERNAME###님,\n\n이 알림은 이메일 주소가 ###SITENAME###에서 ###NEW_EMAIL###로(으로) 변경된 것을 확인하는 것입니다.\n\n이메일 주소를 변경하지 않았다면 사이트 관리자에게 연락해주세요.\n###ADMIN_EMAIL###\n\n이 이메일은 ###EMAIL###에게 보내진 것입니다.\n\n안녕히 계세요,\n###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7472', '3621', 'ko', '0', '', '###USERNAME###님 안녕하세요.\n\n###SITENAME###에서 비밀번호가 변경되었음을 알려드립니다.\n\n직접 비밀번호를 변경한 적이 없다면 사이트 관리자 ###ADMIN_EMAIL### 에게 문의하여 주시기 바랍니다.\n\n이 이메일은 ###EMAIL###에게 보냈습니다.\n\n안녕히 계세요.\n###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7473', '3622', 'ko', '0', '', '안녕하세요,\n\n이 알림은 관리자 이메일 주소가 ###SITENAME###에서 변경된 것을 확인하는 것입니다.\n\n새로운 관리자 이메일 주소는 ###NEW_EMAIL###입니다.\n\n이 이메일은 ###OLD_EMAIL###에게 보내진 것입니다.\n\n안녕히 계세요,\n###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7474', '3623', 'ko', '0', '', '안녕하세요,\n\n이 알림은 네트워크 관리자 이메일 주소가 ###SITENAME###에서 변경된 것을 확인하는 것입니다.\n\n새로운 네트워크 관리자 이메일 주소는 ###NEW_EMAIL###입니다.\n\n이 이메일은 ###OLD_EMAIL###에게 보내진 것입니다.\n\n안녕히 계세요,\n###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:51:00');
