INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7488', '3637', 'ko', '0', '', '얼마나 많은 내용을 표시하시겠습니까?', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7489', '3638', 'ko', '0', '', '안녕하세요 ###USERNAME### 님,\n \n 최근에 계정 이메일 주소를 변경할 것을 요청했습니다.\n \n 맞으면 다음 링크를 클릭해 변경하세요:\n ###ADMIN_URL###\n \n 이 작업을 원하지 않을 경우 무시하고 이 이메일을\n 삭제하세요.\n \n 이 이메일은 ###EMAIL###에게 보내진 것입니다.\n \n 안녕히 계세요,\n ###SITENAME###\n ###SITEURL###', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7490', '3639', 'ko', '0', '', '안녕하세요 ###USERNAME###님,\n \n 최근에 네트워크 관리자 이메일 주소를 변경할 것을\n 요청했습니다.\n \n 이것이 맞을 경우 변경하려면 아래의 링크를 클릭하세요:\n ###ADMIN_URL###\n \n 이 작업을 원하지 않을 경우 무시하고 이 이메일을\n 삭제하세요.\n \n 이 이메일은 ###EMAIL###에게 보내진 것입니다\n \n 안녕히 계세요,\n ###SITENAME###\n ###SITEURL###', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7491', '3640', 'ko', '0', '', '안녕하세요 USERNAME 님,\n\nSITE_NAME 사이트가 성공적으로 설치되었습니다:\nBLOG_URL\n\n아래 정보를 이용해 관리자로 로그인할 수 있습니다:\n\n사용자명: USERNAME\n비밀번호: PASSWORD\n로그인주소: BLOG_URLwp-login.php\n\n새로운 사이트와 함께 즐거운 시간 보내세요. 고맙습니다!\n\n--팀 @ SITE_NAME', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7492', '3641', 'ko', '0', '', '안녕하세요 USERNAME 님,\n\n회원님의 계정이 생성되었습니다.\n\n아래 정보를 이용해 로그인하실 수 있습니다:\n사용자명: USERNAME\n비밀번호: PASSWORD\nLOGINLINK\n\n고맙습니다!\n\n--The Team @ SITE_NAME', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7493', '3642', 'ko', '0', '', '안녕하세요,\n\n다음 계정에 대한 작업요청이 실행됐습니다:\n\n     ###DESCRIPTION###\n\n이를 확인하려면 다음 링크를 클릭해주세요:\n###CONFIRM_URL###\n\n이 작업을 실행하길 원하지 않으시면\n이 이메일을 무시하고 삭제하세요.\n\n이 이메일은 ###EMAIL###로(으로) 보내진 것입니다.\n\n안녕히 계세요,\n###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7494', '3643', 'ko', '0', '', '안녕하세요,\n\n###SITENAME###의 사용자 정보 처리요청이 확인됐습니다:\n\n사용자: ###USER_EMAIL###\n요청: ###DESCRIPTION###\n\n이러한 데이터 처리요청을 보거나 관리하려면 다음에서 할 수 있습니다:\n\n###MANAGE_URL###\n\n안녕히 계세요,\n###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7495', '3644', 'ko', '0', '', '안녕하세요,\n\n###SITENAME###에서 개인 데이터 삭제 요청이 완료됐습니다.\n\n추가 질문이나 관심사항이 있으시면 사이트 관리자에게 연락주세요.\n\n추가 정보는 저희 개인정보 처리지침을 참고하세요: ###PRIVACY_POLICY_URL###\n\n안녕히 계세요,\n###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:51:00');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('7496', '3645', 'ko', '0', '', '안녕하세요,\n\n###SITENAME###에서 개인 데이터 삭제 요청이 완료됐습니다.\n\n추가 질문이나 관심사항이 있으시면 사이트 관리자에게 연락주세요.\n\n안녕히 계세요,\n###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:51:00');
