INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('8990', '5140', 'ko', '0', '', '플래시 플레이어가 활성화 되거나 설치되지지 않은 브라우저를 사용하고 있습니다. 플래시 플레이어 플러그인을 활성화 하거나 최근 버전을 다음에서 다운로드 하세요: https://get.adobe.com/flashplayer/', '0', '', '0', '2018-06-20 09:51:01');
