INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9898', '6067', 'it', '0', '', '<strong>In sintesi</strong> &mdash; Visualizza un riassunto del contenuto del tuo sito e identifica il tema e la versione di WordPress in uso.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9899', '6068', 'it', '0', '', '<strong>Controlli del box</strong> &mdash; Fai clic sulla barra del titolo del box per aprirlo o chiuderlo. Alcuni box aggiunti dai plugin potrebbero avere dei contenuti configurabili e visualizzeranno un link &#8220;Configura&#8221; quando passi il cursore sopra la barra del titolo.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9900', '6069', 'it', '0', '', '<strong>Facendo clic sulla freccia a destra di qualsiasi elemento di un menu</strong> all\'interno dell\'editor apparirà un gruppo di impostazioni standard. Ulteriori impostazioni quali ad esempio la destinazione del link, le classi CSS, la relazione fra i link e la descrizione del link possono venir abilitate o disabilitate tramite la linguetta Opzioni schermo.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9901', '6070', 'it', '0', '', '<strong>Compatibile</strong> con la tua versione di WordPress', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9902', '6071', 'it', '0', '', '<strong>Connessione persa.</strong> il salvataggio è stato disabilitato sino a quando ti riconnetterai.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9903', '6072', 'it', '0', '', '<strong>Elimina</strong> ti porta alla pagina di conferma dell\'eliminazione utente, dove potrai rimuovere definitivamente un utente dal tuo sito ed eliminare i suoi contenuti. Puoi anche eliminare più utenti in una volta sola utilizzando le azioni di gruppo.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9904', '6073', 'it', '0', '', '<strong>Descrizione</strong>  &mdash; La descrizione di base non è importante, tuttavia alcuni temi possono visualizzarla.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9905', '6074', 'it', '0', '', '<strong>Discussione</strong>  &mdash; &Egrave; possibile attivare e disattivare commenti e ping, se ci sono commenti all\'articolo si possono vedere e moderare qui.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9906', '6075', 'it', '0', '', '<strong>Trascina e rilascia</strong> &mdash; Per riorganizzare i riquadri, utilizza il trascina e rilascia facendo clic sulla barra del titolo del riquadro selezionato e rilasciandolo quando si vede un rettangolo con linea tratteggiata grigia apparire nella posizione in cui si desidera posizionare il riquadro.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9907', '6076', 'it', '0', '', '<strong>Trascina e rilascia</strong> i file nella zona sottostante. Sono permessi più file alla volta.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9908', '6077', 'it', '0', '', '<strong>ERRORE:</strong> Si è verificato un errore durante la connessione al server, verificare che le impostazioni siano corrette.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9909', '6078', 'it', '0', '', '<strong>ERRORE</strong>: il "prefisso della tabella" non è valido.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9910', '6079', 'it', '0', '', '<strong>ERRORE</strong>: le password non possono contenere il carattere "\\".', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9911', '6080', 'it', '0', '', '<strong>ERRORE</strong>: inserire un nickname.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9912', '6081', 'it', '0', '', '<strong>ERRORE</strong>: inserire la propria password.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9913', '6082', 'it', '0', '', '<strong>ERRORE</strong>: inserisci un indirizzo email.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9914', '6083', 'it', '0', '', '<strong>ERRORE</strong>: digita la medesima password in entrambi i  campi password.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9915', '6084', 'it', '0', '', '<strong>ERRORE</strong>: pagina delle opzioni non trovata.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9916', '6085', 'it', '0', '', 'Con <strong>Modifica</strong> si verrà portati ad una schermata dove modificare il profilo di questo utente. &Egrave;  possibile raggiungerla anche facendo clic sul nome utente.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9917', '6086', 'it', '0', '', '<strong>Modifica</strong> apre la pagina di modifica dell\'articolo. Si può accedere alla stessa pagina facendo clic sul titolo dell\'articolo.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9918', '6087', 'it', '0', '', '<strong>Formato</strong> - I Formati articolo determinano come il tuo tema visualizzerà un articolo specifico. Ad esempio puoi avere un articolo <em>standard</em> con un titolo e dei paragrafi oppure una <em>digressione</em> che omette il titolo e contiene solo un breve testo. Fai riferimento al Codex per <a href="https://codex.wordpress.org/Post_Formats#Supported_Formats">una descrizione dei vari tipi di formato articolo</a> (in inglese). Il tuo tema pu&ograve; abilitare tutti o solo alcuni dei 10 possibili formati.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9919', '6088', 'it', '0', '', '<strong>Importante</strong>: <a href="https://codex.wordpress.org/WordPress_Backups">fai un backup del database e dei file</a> prima di eseguire l\'aggiornamento. Per ottenere aiuto visita la pagina del Codex: <a href="https://codex.wordpress.org/Updating_WordPress">Aggiornare WordPress</a> (in inglese).', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9920', '6089', 'it', '0', '', '<strong>Incompatibile</strong> con la tua versione di WordPress', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9921', '6090', 'it', '0', '', '<strong>Informazioni</strong> &mdash; La URL del sito viene modificata raramente poiché spesso causa il non funzionamento del sito. Vengono visualizzate le date di Registrazione e di Ultimo aggiornamento. Gli amministratori del network possono contrassegnare un sito come archiviato, spam, cancellato o per adulti, per rimuoverlo dall\'elenco pubblico o per disabilitarlo.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9922', '6091', 'it', '0', '', '<strong>Nome</strong>  &mdash; Il nome come appare sul sito.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9923', '6092', 'it', '0', '', '<strong>Ordine</strong> &mdash; Di norma le pagine sono ordinate alfabeticamente ma è possibile scegliere un ordinamento diverso inserendo un numero (1 per la prima, etc.) in questo campo.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9924', '6093', 'it', '0', '', '<strong>Genitore</strong> &mdash; Le categorie, a differenza dei tag, possono avere una gerarchia. Puoi avere la categoria Jazz e sotto questa avere le categorie figlie per Bebop e Big Band. Il tutto è assolutamente facoltativo. Per creare una sottocategoria scegli semplicemente un\'altra categoria dal menu a discesa genitore.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9925', '6094', 'it', '0', '', '<strong>Genitore</strong>  &mdash; &Egrave; possibile organizzare le pagine in gerarchie. Ad esempio si può avere una pagina &#8220;Informazioni&#8221; che ha le pagine &#8220;Storia della mia vita&#8221; e &#8220;Il mio cane&#8221; sotto di essa. Non vi sono limiti su quanto possono essere annidate profondamente le pagine.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9926', '6095', 'it', '0', '', '<strong>Nota:</strong> ogni personalizzazione effettuata ai file del tema verrà perduta. Per risolvere questo problema utilizza <a href="%s">i temi child</a>.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9927', '6096', 'it', '0', '', '<strong>Editor articolo</strong> &mdash; Immetti il testo del tuo articolo. Vi sono due modalità di modifica: visuale e testo. Scegli la modalità facendo clic sulla linguetta specifica.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9928', '6097', 'it', '0', '', '<strong>Anteprima</strong> mostra l\'aspetto dell\'articolo così come quando sarà pubblicato. Visualizza articolo invece aprirà l\'articolo all\'interno del sito pubblico. Il tipo di link dipende dallo stato dell\'articolo.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9929', '6098', 'it', '0', '', '<strong>Pubblica</strong> &mdash; Puoi impostare i termini di pubblicazione del tuo articolo nel riquadro Pubblica. Per lo Stato, Visibilità e Pubblicazione (immediata), fai clic sul link Modifica per mostrare ulteriori opzioni. La visibilità include le opzioni per proteggere un articolo con una password o per mantenerlo in-definitivamente in cima al proprio blog (in evidenza). L\'opzione di protezione con password permette di impostare una password differente per ciascun articolo. L\'opzione Privato nasconde l\'articolo a chiunque eccetto gli editori e gli amministratori. Pubblica (immediatamente) permette di impostare un a data ed un orario futuro o passato, così che sia possibile programmare un articolo per essere pubblicato in futuro o per pre-datare un articolo.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9930', '6099', 'it', '0', '', '<strong>Bozza rapida</strong> &mdash; Permette di creare un nuovo articolo e di salvarlo come bozza. Inoltre visualizza le 5 bozze più recenti.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9931', '6100', 'it', '0', '', '<strong>Modifica veloce</strong> ti permette di accedere direttamente ai metadati dell\'articolo, così che puoi aggiornare i dettagli senza lasciare questa pagina.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9932', '6101', 'it', '0', '', '<strong>Casuale:</strong> Mostra un\'immagine diversa in ogni pagina.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9933', '6102', 'it', '0', '', '<strong>Rimuovi</strong> ti permette di eliminare un utente dal tuo sito. Non elimina i suoi contenuti. Puoi rimuovere più utenti in una volta utilizzando le azioni di gruppo.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9934', '6103', 'it', '0', '', '<strong>Impostazioni schermo</strong> &mdash; Utilizzare la linguetta Impostazioni schermo per scegliere quali riquadri mostrare in bacheca.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9935', '6104', 'it', '0', '', '<strong>Invia trackback</strong> &mdash; I trackback sono un metodo per notificare ad altri blog che si è fatto un link verso di loro. Inserisci la/le URL alle quali inviare un trackback. Se si effettua un link ad altri siti WordPress questi verranno notificati automaticamente tramite un pingback, e quindi questo campo non è necessario.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9936', '6105', 'it', '0', '', '<strong>Impostazioni</strong> &mdash; Questa pagina mostra un elenco di tutte le impostazioni associate a questo sito. Alcune sono create da WordPress ed altre dai plugin che hai attivato. Si noti che alcuni campi sono in grigio ed indicano Dati serializzati. Non puoi modificare questi valori a causa di come sono memorizzati nel database.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9937', '6106', 'it', '0', '', '<strong>Slug</strong> &mdash; Lo &#8220;slug&#8221; è la versione amichevole della URL del nome. &Egrave; solitamente tutta in minuscolo e contiene solo lettere, numeri e trattini.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9938', '6107', 'it', '0', '', '<strong>Template</strong>  &mdash; Alcuni temi hanno dei template personalizzati da poter utilizzare per determinate pagine, che possono contenere funzionalità aggiuntive o una grafica personalizzata. Se così fosse, queste appariranno in questo menu a discesa.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9939', '6108', 'it', '0', '', '<strong>Non si trova il tema genitore.</strong> Occorre installare il tema genitore %s prima di poter utilizzare questo tema figlio.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9940', '6109', 'it', '0', '', '<strong>Temi e plugin</strong> &mdash; Per aggiornare singolarmente i temi ed i plugin da questa schermata, usa le caselle di controllo per effettuare la tua scelta, quindi <strong>fai clic sul pulsante &#8220;Aggiorna&#8221;</strong>. Per aggiornare in blocco tutti i temi e i plugin, puoi utilizzare la casella di controllo posizionata in cima alla sezione per selezionarli tutti insieme prima di fare clic sul pulsante &#8220;Aggiorna&#8221;.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9941', '6110', 'it', '0', '', '<strong>Temi</strong> &mdash; Questa area visualizza i temi non ancora abilitati sulla rete. Abilitando un tema in questo menu lo si rende accessibile a questo sito. Non attiva il tema ma permette di visualizzarlo nel sito sotto il menu Aspetto. Per abilitare un tema per tutto il network, si veda la schermata <a href="%s">Temi del network</a>.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9942', '6111', 'it', '0', '', '<strong>Titolo</strong>  &mdash; Scrivi un titolo per l\'articolo. Dopo aver scritto il titolo, si vedrà il permalink sotto al titolo, che potrà essere modificato.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9943', '6112', 'it', '0', '', '<strong>Traduzioni</strong> &mdash; I file che traducono WordPress nella tua lingua sono aggiornati ogni volta che c\'è un aggiornamento. Ma se questi file non sono aggiornati, <strong>puoi fare clic sul pulsante &#8220;Aggiorna traduzioni&#8221;</strong>.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9944', '6113', 'it', '0', '', '<strong>Cestina</strong> rimuove l\'articolo da questa lista e lo sposta nel cestino, dove può essere eliminato definitivamente.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9945', '6114', 'it', '0', '', '<strong>Utenti</strong> &mdash; Qui vengono visualizzati gli utenti associati a questo sito. Puoi cambiare il loro ruolo, azzerare la loro password o rimuoverli dal sito. Rimuovendo un utente dal sito non si rimuove l\'utente da tutto il network.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('9946', '6115', 'it', '0', '', '<strong>La versione %1$s</strong> corregge %2$s bug.', '0', '', '0', '2018-06-20 09:52:04');
