INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10499', '6668', 'it', '0', '', 'Ogni plugin e tema presente nella directory di WordPress.org è 100%% GPL o ha una licenza altrettanto libera e compatibile a questa, quindi sei al sicuro nel cercare <a href="%1$s">plugin</a> e <a href="%2$s">temi</a> nelle directory ufficiali. Se ottieni un plugin o un tema da altre fonti, assicurati per prima cosa di <a href="%3$s">chiedere se è sotto licenza GPL</a>. Se non rispettano la licenza WordPress noi non ne raccomandiamo l\'utilizzo.', '0', '', '0', '2018-06-20 09:52:04');
