INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10578', '6747', 'it', '0', '', 'Solo per le immagini, &egrave; possibile fare clic su Modifica immagine sotto la miniatura per espandere un editor di immagini in linea con le icone per il ritaglio, la rotazione ed il ribaltamento dell\'immagine così come per annullare o ripetere le operazioni. I riquadri sulla destra forniscono ulteriori opzioni per scalare l\'immagine, per ritagliarla e per ritagliare la miniatura in maniera diversa da come viene ritagliata l\'immagine originale. &Egrave; possibile fare clic su Aiuto all\'interno di questi riquadri per ottenere maggiori informazioni.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10579', '6748', 'it', '0', '', 'Per ulteriori informazioni consulta <a href="%s">le note di versione</a>.', '0', '', '0', '2018-06-20 09:52:04');
