INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10639', '6808', 'it', '0', '', 'Posizionandosi con il mouse sopra una riga nella lista degli articoli, si attiveranno dei link che permettono di gestire l\'articolo. &Egrave; possibile eseguire le seguenti azioni:', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10640', '6809', 'it', '0', '', 'Passando con il mouse su una riga della lista degli utenti, verranno mostrati dei link che permetteranno di gestire gli Utenti. &Egrave; possibile effettuare le seguenti azioni:', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10641', '6810', 'it', '0', '', 'Passando il mouse su una riga vengono mostrati dei link di azione: Modifica, Elimina definitivamente e Visualizza. Facendo clic su Modifica o sul nome del file multimediale si visualizza una semplice schermata di modifica dei metadati del singolo file. Facendo click su Elimina definitivamente il file verrà eliminato dalla Libreria media (e da ogni articolo a cui è attualmente collegato). Visualizza mostrerà la pagina di visualizzazione di quel file.', '0', '', '0', '2018-06-20 09:52:04');
