INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10646', '6815', 'it', '0', '', 'Ciao ###USERNAME###,\n\nhai recentemente fatto clic nel tuo sito sul collegamento «Cancella sito» ed hai compilato un\nmodulo su quella pagina.\n\nSe desideri realmente cancellare il tuo sito fai clic sul collegamento sottostante. Non ti verrà\nchiesta nessuna ulteriore conferma quindi fai clic su questo collegamento solo se sei assolutamente sicuro di volerlo fare:\n###URL_DELETE###\n\nSe cancelli il tuo sito considera la possibilità in futuro di aprirne un altro\nsempre qui! (Ma ricorda che il sito corrente ed il nome utente sono persi per sempre.)\n\nGrazie per aver usato il sito,\nIl webmaster di\n###SITE_NAME###', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10647', '6816', 'it', '0', '', 'Ciao ###USERNAME###,\n\nRecentemente hai richiesto la modifica dell’indirizzo email di amministrazione\ndel tuo sito.\n\nSe è corretto, fai clic sul seguente link per cambiarlo:\n###ADMIN_URL###\n\nPuoi tranquillamente ignorare ed eliminare questa email se non vuoi\neffettuare questa operazione.\n\nQuesta email è stata inviata a ###EMAIL###\n\nSaluti,\na tutti da ###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10648', '6817', 'it', '0', '', 'Ciao! Il tuo sito su %1$s è stato aggiornato automaticamente a WordPress %2$s.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10649', '6818', 'it', '0', '', 'Ciao,\n\nLa tua richiesta di esportazione dei dati personali è stata completata. Puoi\nscaricare i tuoi dati personali facendo clic sul link sottostante. Per privacy\ne sicurezza, cancelleremo automaticamente il file il giorno ###EXPIRATION###,\nquindi scaricalo prima di allora.\n\n###LINK###\n\nQuesta email è stata inviata a ###EMAIL###.\n\nSaluti,\na tutti da ###SITENAME###\n###SITEURL###', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10650', '6819', 'it', '0', '', 'Tuttavia, è tua responsabilità usare correttamente tali risorse, fornendo le informazioni richieste dalla tua privacy policy e mantenendole aggiornate ed accurate.', '0', '', '0', '2018-06-20 09:52:04');
