INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10656', '6825', 'it', '0', '', 'Identicon (generato)', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10657', '6826', 'it', '0', '', 'Se un file multimediale non è stato allegato ad alcun contenuto, vedrai il suo stato nella colonna &#8220;Caricato in&#8221; e potrai fare clic su &#8220;Allega&#8221; per aprire un piccolo popup che ti permetterà di ricercare un contenuto esistente a cui allegare il file.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10658', '6827', 'it', '0', '', 'Se è disponibile un aggiornamento, vedrai una notifica apparire nella barra degli strumenti e nel menu di navigazione.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10659', '6828', 'it', '0', '', 'Se lo si desidera, WordPress automaticamente allerta i vari servizi quando vi sono nuovi articoli.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10660', '6829', 'it', '0', '', 'Se per qualsiasi motivo la creazione automatica dei file non funziona, non ti preoccupare. Tutto questo non fa altro che inserire le informazioni nel database e in un file di configurazione. Puoi  aprire %1$s in un editor di testo, inserire i tuoi dati, e salvarlo come %2$s.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10661', '6830', 'it', '0', '', 'Se si verifica un problema con un plugin e non è possibile utilizzare WordPress, elimina o rinomina questo file nella directory %s e il plugin verrà automaticamente disattivato.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10662', '6831', 'it', '0', '', 'Se l’importatore che ti serve non è nell’elenco, <a href="%s">cerca nella directory dei plugin</a> per verificare se un importatore è disponibile.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10663', '6832', 'it', '0', '', 'Se il link &egrave; a una persona, puoi indicare il tipo di relazione usando il modulo qui sopra. Se vuoi saperne di pi&ugrave; su questa idea, dai un\'occhiata a <a href="http://gmpg.org/xfn/">XFN</a>.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10664', '6833', 'it', '0', '', 'Se la directory principale del tuo sito fosse <a href="%1$s">scrivibile</a> avremmo potuto farlo automaticamente, ma siccome non lo è queste sono le regole di rewrite delle url che dovresti avere nel tuo file %2$s. Crea un nuovo file, di nome %2$s, nella directory principale del tuo sito. Fai clic nel campo e premi %3$s per selezionare tutto. Quindi inserisci questo codice nel file %2$s.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10665', '6834', 'it', '0', '', 'Se devi assolutamente fare modifiche dirette a questo plugin, utilizza un gestore file per creare una copia con un nuovo nome e sospendere l\'originale. In questo modo puoi riattivare una versione funzionante se qualcosa va storto.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10666', '6835', 'it', '0', '', 'Se hai già predisposto una pagina privacy policy, selezionala qui sotto. Altrimenti, creane una.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10667', '6836', 'it', '0', '', 'Se sei un membro di un\'industria regolamentata, o se sei soggetto a ulteriori leggi sulla privacy, potrebbe esserti richiesto di rivelare tale informazione qui.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10668', '6837', 'it', '0', '', 'Se stai cercando di utilizzare il gestore dei link installa il plugin <a href="%s">Link Manager</a>.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10669', '6838', 'it', '0', '', 'Se decidi comunque di andare avanti con le modifiche dirette, utilizza un gestore file per creare una copia con un nome nuovo e sospendere l\'originale. In questo modo puoi riattivare una versione funzionante se qualcosa va storto.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10670', '6839', 'it', '0', '', 'Se un link viene cancellato, viene rimosso definitivamente, dato che i link per ora non hanno la funzione cestino.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10671', '6840', 'it', '0', '', 'Se non si ricordano le proprie credenziali, occorre contattare il vostro fornitore di hosting web.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10672', '6841', 'it', '0', '', 'Se non desideri utilizzare più il sito %s, puoi eliminarlo utilizzando il modulo sottostante. Quando farai clic su <strong>Elimina il sito definitivamente</strong> riceverai una email con un link. Fai clic su questo link per eliminare il sito.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10673', '6842', 'it', '0', '', 'Se non  desideri che venga visualizzata una immagine nella testata del proprio sito, fai clic sul pulsante &#8220;Rimuovi immagine testata&#8221; in basso nella sezione Immagine testata di questa pagina. Se vuoi riabilitare successivamente  l\'immagine della testata basterà selezionare una della altre opzioni immagine e fare clic su &#8220;Salva modifiche&#8221;.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10674', '6843', 'it', '0', '', 'Se non si desidera caricare una propria immagine, è possibile utilizzare una di queste belle intestazioni o mostrarne una casuale.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10675', '6844', 'it', '0', '', 'Se modifichi o pubblichi un articolo, un cookie aggiuntivo verrà salvato nel tuo browser. Questo cookie non include dati personali, ma indica semplicemente l\'ID dell\'articolo appena modificato. Scade dopo 1 giorno.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10676', '6845', 'it', '0', '', 'Se hai problemi di qualsiasi tipo o hai bisogno di aiuto, i volontari dei forum di supporto su https://it.wordpress.org/forums/ possono riuscire ad aiutarti.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10677', '6846', 'it', '0', '', 'Se hai un plugin in formato .zip, puoi installarlo caricandolo qui.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10678', '6847', 'it', '0', '', 'Se si dispone di un tema in formato .zip, è possibile installarlo caricandolo da qui.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10679', '6848', 'it', '0', '', 'Se hai un account e accedi a questo sito, verrà impostato un cookie temporaneo per determinare se il tuo browser accetta i cookie. Questo cookie non contiene dati personali e viene eliminato quando chiudi il browser.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10680', '6849', 'it', '0', '', 'Se hai un account su questo sito, o hai lasciato commenti, puoi richiedere di ricevere un file esportato dal sito con i dati personali che abbiamo su di te, compresi i dati che ci hai fornito. Puoi anche richiedere che cancelliamo tutti i dati personali che ti riguardano. Questo non include i dati che siamo obbligati a conservare per scopi amministrativi, legali o di sicurezza.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10681', '6850', 'it', '0', '', 'Se hai contrassegnato dei plugin come preferiti su WordPress.org puoi visualizzarli qui.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10682', '6851', 'it', '0', '', 'Se hai segnato dei temi come preferiti su WordPress.org, puoi sfogliarli qui. ', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10683', '6852', 'it', '0', '', 'Se hai articoli o commenti su un’altra piattaforma, WordPress può importarli in questo sito. Per iniziare, seleziona dall\'elenco qui sotto una piattaforma dalla quale importare:', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10684', '6853', 'it', '0', '', 'Se non hai ancora creato un menu, per iniziare <strong>fai clic sul link &#8217;crea un nuovo menu&#8217; link</strong>', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10685', '6854', 'it', '0', '', 'Se desideri avere solo una idea di quello che è disponibile puoi sfogliare i plugin In evidenza e quelli popolari utilizzando i link sopra l\'elenco dei plugin. Queste sezioni si aggiornano con regolarità.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10686', '6855', 'it', '0', '', 'Se sai cosa stai cercando la Ricerca è allora la miglior soluzione. La schermata di ricerca ha una opzione per ricercare nella Directory dei Plugin di WordPress.org in base ad uno specifico termine, autore e tag. Puoi anche cercare nella directory ricercando i tag più popolari. I tag più popolari in linea di massima indicano che più plugin sono stati contrassegnati con essi.', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10687', '8516', 'it', '3', 'prodotto', '', '0', '', '0', '2018-06-20 09:52:04');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10688', '6856', 'it', '0', '', 'Se lasci un commento sul nostro sito, puoi scegliere di salvare il tuo nome, indirizzo email e sito web nei cookie. Sono usati per la tua comodità in modo che tu non debba inserire nuovamente i tuoi dati quando lasci un altro commento. Questi cookie dureranno per un anno.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10689', '6857', 'it', '0', '', 'Se lasci un commento, il commento e i relativi metadati vengono conservati a tempo indeterminato. È così che possiamo riconoscere e approvare automaticamente eventuali commenti successivi invece di tenerli in una coda di moderazione.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10690', '6858', 'it', '0', '', 'Se lo desideri, qui puoi inserire una struttura personalizzata delle URL per le categorie ed i tag. Ad esempio, utilizzando <code>argomenti</code> come base delle categorie i link delle categorie saranno del tipo <code>%s/argomenti/senza-categoria/</code>. Lasciando queste impostazioni vuote verranno utilizzati i valori predefiniti.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10691', '6859', 'it', '0', '', 'Se devi reinstallare la versione %s, puoi farlo qui:', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10692', '6860', 'it', '0', '', 'Se selezioni un\'impostazione diversa da quella predefinita, il path della URL generale con struttura tag (tag racchiusi da <code>%</code>) apparirà nel campo struttura personalizzata e potrai modificarla ulteriormente.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10693', '6861', 'it', '0', '', 'Se ci contatti vedremo di assicurarci che tu non abbia mai più questo problema.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10694', '6862', 'it', '0', '', 'Se sei arrivato a questa schermata per caso e vuoi andare in uno dei tuoi siti, qui ci sono alcune scorciatoie per trovare la strada corretta.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10695', '6863', 'it', '0', '', 'Se si rende il file %s temporaneamente scrivibile affinché sia possibile generare le regole di riscrittura in maniera automatica, non dimenticarsi di ripristinare i permessi una volta che le regole sono state salvate.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10696', '6864', 'it', '0', '', 'Se si rende temporaneamente scrivibile la directory radice del proprio sito, per poter generare automaticamente il file%s, non dimenticarsi di ripristinare i permessi una volta che il file è stato creato.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10697', '6865', 'it', '0', '', 'Se carichi immagini sul sito web, dovresti evitare di caricare immagini che includono i dati di posizione incorporati (EXIF GPS). I visitatori del sito web possono scaricare ed estrarre qualsiasi dato sulla posizione dalle immagini sul sito web.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10698', '6866', 'it', '0', '', 'Se usi il tuo sito per scopi commerciali e ti impegni in una raccolta più complessa o nel trattamento dei dati personali, dovresti prendere nota delle seguenti informazioni nella tua privacy policy oltre alle informazioni di cui abbiamo già discusso.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10699', '6867', 'it', '0', '', 'Se si desidera che i  visitatori del sito possano registrarsi da soli, invece che solo dagli amministratori, selezionare la casella membership. Sarà possibile impostare un ruolo utente predefinito per tutti i nuovi utenti, siano essi auto-registrati o registrati da un amministratore del sito.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10700', '6868', 'it', '0', '', 'Se desideri convertire le categorie in tag (o viceversa), utilizza lo strumento <a href="%s">convertitore di categorie e tag</a> disponibile nella pagina Importa.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10701', '6869', 'it', '0', '', 'Se vuoi installare un plugin che hai scaricato da qualche parte fai clic sul link Carica che si trova sopra l\'elenco dei plugin. Ti verrà richiesto di caricare il pacchetto .zip ed una volta caricato potrai attivare il nuovo plugin.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10702', '6870', 'it', '0', '', 'Se è necessario effettuare delle modifiche ma non si desidera che siano sovrascritte quando il plugin verrà aggiornato, è probabile sia necessario scrivere il proprio plugin. Per informazioni sulla modifica di un plugin o sulla scrittura da zero di un plugin, controllare il link seguente.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10703', '6871', 'it', '0', '', '&Egrave; possibile rimuovere i widget mantenendo le impostazioni per usi futuri, è sufficiente trascinare il widget nella sezione widget inattivi. &Egrave; possibile aggiungere nuovamente in widget da questa area. Questo è utile quando si cambia tema e se ne utilizza uno con meno o differenti aree widget.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10704', '6872', 'it', '0', '', 'Modifica questa voce se desideri eseguire più installazioni di WordPress su un singolo database.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10705', '6873', 'it', '0', '', 'Se desideri visualizzare più plugin tra cui scegliere, fai clic sul pulsante "Aggiungi nuovo"  e potrai sfogliare o cercare nuovi plugin nella <a href="%s">Directory dei plugin di WordPress.org</a>. I plugin presenti nella directory dei plugin di WordPress sono progettati e sviluppati da terze parti, e sono compatibili con la licenza che utilizza WordPress. Oh, e sono gratuiti!', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10706', '6874', 'it', '0', '', 'Se desideri vedere altri temi da selezionare, fai clic sul pulsante «Aggiungi nuovo» e potrai scorrere o ricercare temi aggiuntivi dalla <a href="%s">directory dei temi di WordPress.org</a>. I temi nella directory dei temi di WordPress.org sono disegnati e sviluppati da terze parti e sono compatibili con la licenza d’uso di WordPress. Hey, sono gratuiti!', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10707', '6875', 'it', '0', '', 'Se il tuo file %1$s fosse stato <a href="%2$s">scrivibile</a>, avremmo potuto fare questo automaticamente, ma non lo era quindi queste sono le regole mod_rewrite che dovresti avere nel tuo file %1$s. Fare clic nel campo e premere %3$s per selezionare tutto.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10708', '6876', 'it', '0', '', 'Se il file %1$s fosse <a href="%2$s">scrivibile</a>, avremmo potuto farlo automaticamente, ma siccome non lo è queste sono le regole di rewrite delle url che dovresti avere nel tuo file %1$s. Fai clic nel campo e premi %3$s per selezionare tutto. Quindi inserisci questa regola all\'interno dell\'elemento  %4$s nel file %1$s.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10709', '6877', 'it', '0', '', 'Se il tema ha più di una immagine di testata oppure hai caricato più di una immagine, hai la possibilità di far si che WordPress visualizzi casualmente una delle immagini su ciascuna pagina del sito. Fai clic sul pulsante radio &#8220;Casuale&#8221; accanto alla sezione Immagini caricate o Immagini predefinite per abilitare questa funzionalità.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10710', '6878', 'it', '0', '', 'Se il tuo sito web fornisce un servizio che include il processo decisionale automatico, per esempio permettere ai clienti di richiedere credito, o aggregare i loro dati in un profilo pubblicitario - devi notare che questo sta succedendo, e include informazioni riguardo come quell\'informazione è usata, quali decisioni sono fatte con quei dati aggregati, e quali diritti hanno gli utenti sulle decisioni prese senza intervento umano.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10711', '6879', 'it', '0', '', 'Se il tuo sito web riceve dati sugli utenti da terze parti, compresi gli inserzionisti, queste informazioni devono essere incluse nella sezione della tua privacy policy che tratta i dati di terze parti.', '0', '', '0', '2018-06-20 09:52:05');
