INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10742', '6910', 'it', '0', '', 'Spiega in poche parole l&#8217;argomento di questo sito.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10743', '6911', 'it', '0', '', 'Oltre a elencare i dati personali che raccogli, devi motivare perché li raccogli. Queste spiegazioni devono considerare sia la base legale per la raccolta e la conservazione dei dati sia il consenso attivo che l\'utente ha fornito.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10744', '6912', 'it', '0', '', 'Con ogni probabilità, queste informazioni ti sono state già fornite dal tuo fornitore di hosting. Se non disponi di queste informazioni, dovrai contattare il tuo fornitore prima di poter proseguire. Se invece è tutto pronto&hellip;', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10745', '6913', 'it', '0', '', 'In molti casi, WordPress eseguirà automaticamente, al tuo posto ed in background, operazioni di manutenzione e aggiornamenti di sicurezza.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10746', '6914', 'it', '0', '', 'Nelle precedenti versioni di WordPress tutti gli strumenti di importazione erano inclusi nella distribuzione. Sono stati trasformati in plugin perché la maggior parte delle persone li utilizza una sola volta o comunque molto raramente.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10747', '6915', 'it', '0', '', 'In risposta a %s.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10748', '6916', 'it', '0', '', 'In risposta a: %s', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10749', '6917', 'it', '0', '', 'In risposta a: %s', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10750', '6918', 'it', '0', '', 'Nella colonna <strong>Autore</strong>, oltre al nome dell&#8217;autore, indirizzo email e URL del blog, viene mostrato l&#8217;indirizzo IP del commentatore. Facendo clic su questo link verranno mostrati tutti i commenti scritti da quell&#8217;indirizzo IP.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10751', '6919', 'it', '0', '', 'Nella colonna <strong>commento</strong>, spostare il mouse sopra ogni commento  ti da le opzioni per approvare, rispondere (e approvare), modificare velocemente, modificare, segnalare come spam, o spostare nel cestino quel commento.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10752', '6920', 'it', '0', '', 'Nella colonna <strong>In risposta a</strong> vi sono tre elementi. Il testo è il nome dell\'articolo che ha ispirato il commento e si collega all\'editor degli articoli per la specifica voce. Il link Visualizza articolo porta all\'articolo direttamente sul sito. Il piccolo fumetto con dentro un numero mostra il numero di commenti approvati che l\'articolo ha ricevuto. Se il fumetto è grigio tutti i commenti per quell\'articolo sono stati moderati. Se è blu vi sono dei commenti in attesa di moderazione. Facendo clic sul fumetto si filtrerà la schermata dei commenti per mostrare solo i commenti relativi a quell\'articolo.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10753', '6921', 'it', '0', '', 'Nella colonna <strong>inviato il</strong>, appare la data e l\'ora in cui il commento è stato scritto. Facendo clic sul link data/ora ti sarai portato a quel commento sul tuo sito.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10754', '6922', 'it', '0', '', 'Nella sezione Testo testata di questa pagina puoi scegliere se visualizzare o meno questo testo. Puoi anche scegliere il colore del testo facendo clic sul pulsante Seleziona colore e quindi inserire un valore HTML esadecimale legittimo, es. &#8220;#ff0000&#8221; per il rosso oppure impostare il colore tramite il selezionatore dei colori.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10755', '6923', 'it', '0', '', 'In questa sezione dovresti spiegare per quanto tempo conservi i dati personali raccolti o elaborati dal sito web. Anche se è tua responsabilità descrivere per quanto tempo mantieni ogni set di dati e perché lo mantieni, queste informazioni devono essere elencate qui. Ad esempio, potresti voler dire che mantieni le voci dei moduli di contatto per sei mesi, i record delle statistiche per un anno e i record di acquisto dei clienti per dieci anni.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10756', '6924', 'it', '0', '', 'In questa sezione dovresti spiegare quali misure hai preso per proteggere i dati dei tuoi utenti&#8217. Questo potrebbe includere misure tecniche come la crittografia; misure di sicurezza come l\'autenticazione a due fattori; e misure come la formazione del personale sulla protezione dei dati. Qui puoi anche menzionare se hai effettuato una valutazione dell\'impatto sulla privacy.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10757', '6925', 'it', '0', '', 'In questa sezione, dovresti spiegare quali procedure attuerai nell\'eventualità di una falla dei dati, sia essa potenziale o reale, come ad esempio sistemi di report interni, messa in contatto automatica o cacciatori di bug.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10758', '6926', 'it', '0', '', 'In questa sezione dovresti indicare quali diritti hanno i tuoi utenti nella gestione dei loro dati e come possono esercitarli', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10759', '6927', 'it', '0', '', 'In questa sezione dovresti elencare tutti i trasferimenti di dati del sito al di fuori dell\'Unione Europea e descrivere in che modo i dati sono salvaguardati in base agli standard europei di protezione dei dati. Questo potrebbe includere il tuo web hosting, il cloud storage o altri servizi di terze parti.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10760', '6928', 'it', '0', '', 'In questa sezione dovresti nominare ed elencare tutti i fornitori di terze parti con cui condividi i dati del sito, inclusi partner, servizi basati su cloud, sistemi di pagamento e fornitori di servizi di terze parti, e riportare quali dati condividi con loro e perché. Aggiungi un collegamento alle loro privacy policies, se possibile.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10761', '6929', 'it', '0', '', 'In questa sezione dovresti annotare quali dati personali raccogli dagli utenti e visitatori del sito. Questo potrebbe includere dati personali, come nome, indirizzo email, preferenze personali sull\'account; dati transazionali, come informazioni sugli acquisti; e dati tecnici, come informazioni sui cookies.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10762', '6930', 'it', '0', '', 'In questa sezione è necessario riportare l\'URL del sito, nonché il nome dell\'azienda, dell\'organizzazione o dell\'individuo dietro di esso e alcune informazioni di contatto accurate.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10763', '6931', 'it', '0', '', 'In questa sezione si dovrebbe segnalare un metodo di contatto per problemi riguardanti la privacy. Se è necessario disporre di un Responsabile della Protezione dei Dati (DPO), elencare qui il loro nome e i dettagli completi del contatto.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('10764', '6932', 'it', '0', '', 'In questa sottosezione dovresti elencare i cookie utilizzati dal tuo sito web, compresi quelli impostati dai tuoi plugin, social media e statistiche. Abbiamo fornito i cookie che WordPress installa di default.', '0', '', '0', '2018-06-20 09:52:05');
