INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11516', '7684', 'it', '0', '', 'La sezione Widget disponibili contiene tutti i widget che è possibile utilizzare. Una volta trascinato un widget su una barra laterale, questo si aprirà per permettere di impostare i suoi parametri. Quando avrai terminato di modificare le impostazioni del widget, fare clic sul pulsante salva ed il widget verrà visualizzato sul sito. Se si fa clic sul pulsante Elimina, il widget verrà rimosso.', '0', '', '0', '2018-06-20 09:52:05');
INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11517', '7685', 'it', '0', '', 'Il link al Convertitore di categorie e tag presente in questa schermata porta alla schermata di importazione dove il Convertitore è uno dei plugin che è possibile installare. Una volta installato il link Esegui importatore porterà ad una schermata dove è possibile scegliere se convertire i tag in categorie o viceversa.', '0', '', '0', '2018-06-20 09:52:05');
