INSERT INTO `wp_icl_string_translations` (`id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES ('11522', '7690', 'it', '0', '', 'La modalità testuale ti consente di immettere codice HTML assieme al testo del tuo articolo. Tieni a mente che i tag &lt;p&gt; e &lt;br&gt; sono automaticamente convertiti in interruzioni di riga quando si passa alla modalità testuale per renderla meno disordinata. Mentre scrivi, puoi usare un singolo a capo invece di scrivere &lt;br&gt; e due a capo al posto di un tag di paragrafo. Gli a capo sono automaticamente convertiti in tag.', '0', '', '0', '2018-06-20 09:52:05');
